import React, {useEffect, useState} from 'react';
import axios from "axios";

// Fonction utilitaire exportée
export const getDistanceBetweenTwoPlaces = async () => {
    const myAPIKey = "c81205a4fb97473b93dd0df61a9838c6";
    const fromWaypoint = [38.937165, -77.04559];
    const toWaypoint = [38.881152, -76.990693];
    const url = `https://api.geoapify.com/v1/routing?waypoints=${fromWaypoint.join(",")}|${toWaypoint.join(",")}&mode=drive&details=instruction_details&apiKey=${myAPIKey}`;

    const response = await axios.get(url);
    return response.data;
};

// Composant React pour tester / afficher les résultats
    const Geoapify = () => {
    const [routeData, setRouteData] = React.useState(null);
    const [error, setError] = React.useState(null);

    React.useEffect(() => {
        getDistanceBetweenTwoPlaces()
            .then((data) => setRouteData(data))
            .catch((error) => setError(error.message));
    }, []);

    if (error) {
        return <div>Error: {error}</div>;
    }

    if (!routeData) {
        return <div>Loading...</div>;
    }

    return (
        <div>
            <h1>Route Information</h1>
            <pre>{JSON.stringify(routeData, null, 2)}</pre>
        </div>
    );
};

export default Geoapify;
